INSERT INTO `print_pattern` VALUES (1,' Ревин И.А. 	3000 Ремонтов      www.3000remontov.ru 		тел.   8-917-211-77-78','1.Срок выполнения заказа оговаривается дополнитель. 2.Аппаратура возвращается по предъявлению листа-заказа. При утрате листа-заказа необходимо немедленно сообщить об этом по телефону, либо лично, в противном случае Ревин И.А. не несет ответственность за получение аппарата другим лицом. 3.Аппаратура с согласия заказчика принята без разборки, проверки неисправностей.Заказчик согласен, что все неисправности и внутренние повреждения, которые могут быть обнаруженны в аппаратуре при диагностике/ремонте, возникли до приема аппарата в ремонт по данному заказу. 4.В соответствии с п.2 ст35 Закона \"О защите прав потребителей\" Заказчик и Ревин И.А. пришли к соглашению, что стоимость сдаваемого в ремонт аппарата составляет 300 (триста)рублей. 5.При неполучении аппарата заказчиком более 30 дней с момента сдачи в ремонт, хранение изделия осуществляется на платном складе, и составляет 10 рублей в сутки. 6.При неполучении аппарата заказчиком более 180 дней с момента сдачи в ремонт изделие утилизируется.','Принял:________________','Сдал:________________','Заказ:','ФИО:','Телефон:','Примечание:','От:','Аппарат:','Модель:','Состояние:','Дефект со слов клиента:');
